import React from "react";
import Filebox from "./Filebox";
import LectureBar from "./LectureBar";
class App extends React.Component {
  state = { onPlay: false };
  render() {
    console.log("app onplay :", this.state.onPlay);
    return (
      <div>
        <LectureBar />
        <Filebox />
      </div>
    );
  }
}

export default App;
